import React, {Component} from 'react';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableCell';
import {Button} from 'react-bootstrap';

class MyPostItems extends Component {
    render(){
        return(
            <TableRow>
                <TableCell>{this.props.id}</TableCell>
                <TableCell>{this.props.nickname}</TableCell>
                <TableCell>{this.props.createDate}</TableCell>
                <TableCell>{this.props.updateDate}</TableCell>
                <TableCell>{this.props.content}</TableCell>
                <TableCell><Button variant="outline-warning">수정</Button></TableCell>
                <TableCell><Button variant="outline-danger">삭제</Button></TableCell>
            </TableRow>
        );
    }
}

export default MyPostItems;
